import './App.css';
import { useState } from 'react';
import React from 'react'




function App() {
  const [Weatherlist, SetWeatherlist] = useState(null);

 const fetchData = async () => {
  try {
    const response = await fetch('api.coincap.io/v2/assets');
    const jsonData = await response.json();
    SetWeatherlist(jsonData);
  } catch (error) {
    console.error('Error:', error);
  }
};
useEffect(() => {
  fetchData();
}, []);

  return (
    <div className="App">


     <ul>
     {Weatherlist.map((item) => <li>{item.id}</li>)}
     </ul>



    </div>
  );
}










export default App;
